          </section>
          <section>
            <h1>Waving</h1>

            <Player file={"/waving.mp3"} />
          </section>
          <section>
            <h1>Changes</h1>

            <Player file={"/get-your-changes-in.mp3"} />
          </section>
          <section>
            <h1>Recap</h1>

            <Player file={"/debussy.mp3"} />
          </section>
          <section>
            <h1>Art Attack</h1>

            <Player file={"/art-attack.mp3"} />
          </section> */}
          <section>
            {" "}
            <Spotify />
          </section>
        </div>
      </div>
    </>
  );
};

export default Deck;
